import React from 'react';

import Link from 'next/link';
import styled from 'styled-components';
import Nav from './Nav';

const Logo = styled.h1`
  background: red;
  margin-left: 2rem;
  font-size: 4rem;
  z-index: 2;
  position: relative;
  transform: skew(-7deg);
  a {
    color: white;
  }
`;

export const Header = () => (
  <header>
    <div className="bar">
      <Logo>
        {' '}
        <Link href="/"> Sick fits</Link>
      </Logo>
    </div>
    <div className="sub-bar" />
    <p>Search</p>

    <Nav />
    <p>UI am the header</p>
  </header>
);
